def solve():
    # Remove newlines and split by commas
    parts = stabilizers_data.replace('\n', ' ').split(',')
    stabilizers = [p.strip() for p in parts if p.strip()]
    
    print(f"Found {len(stabilizers)} stabilizers.")
    if stabilizers:
        print(f"Length of first stabilizer: {len(stabilizers[0])}")
        # Verify length 161
        if len(stabilizers[0]) != 161:
             print("WARNING: Stabilizer length is not 161!")

    try:
        pauli_strings = [stim.PauliString(s) for s in stabilizers]
        tableau = stim.Tableau.from_stabilizers(pauli_strings, allow_underconstrained=True, allow_redundant=True)
        circuit = tableau.to_circuit("elimination")
        
        with open('circuit_161.stim', 'w') as f:
            f.write(str(circuit))
            
        print("Circuit generated and saved to circuit_161.stim")
        
    except Exception as e:
        print(f"Error: {e}")

if __name__ == "__main__":
    solve()
